import React, {Component, Components} from "react";
import "./main.css"

import Towers from "./towers";

const myContext = React.createContext();

class Main extends Component {
    constructor(props) {
        super(props);

        this.state = {
            game: {
                patch: "v1.1.0",
                potatoes: 0,
                PpS: 0,
                potatoUp: 0,
                spudSpitter: 0,
                spudSpitterCost: 10,

                farmer: 0,
                farmerCost: 50,
                farmerPpSadd: 1,

                farm: 0,
                farmCost: 300,
                farmPpSadd: 5,

                factory: 0,
                factoryCost: 1000,
                factoryPpSadd: 20,

                district: 0,
                districtCost: 5000,
                districtPpSadd: 50,

                convention: 0,
                conventionCost: 20000,
                conventionPpSadd: 100,

                merchandise: 0,
                merchandiseCost: 100000,
                merchandisePpSadd: 500,

                cult: 0,
                cultCost: 666666,
                cultPpSadd: 3000,

                sponsorships: 0,
                sponsorshipsCost: 1234567,
                sponsorshipsPpSadd: 10000,

                biggerYields: 0,
                moreFields: 0,
                looserLaws: 0,
                districtExpansion: 0,
                moreBooths: 0,
                sleekerDesigns: 0,
                potatoSkinSacrifice: 0,
                moreBrands: 0
            }
        }
    }

    clickFirstButton = () => {
        this.game.potatoes += this.game.potatoUp;
        console.log(this.game.potatoes);
    }

    render() {
        return(
            <div>
                {/* Main Div with Potatoes and PpS */}
                <div id="showVar">
                    <p id="varCount">Potatoes: 0</p>
                    <p id="PpSCount">PpS: 0</p>
            
                    {/* Progress Bar */}
                    {/* <div class="progress-grey">
                        <div class="progress-green" id="progressBar" style="height:24px;width:0"></div>
                    </div> */}
                </div>

                <br />
                <br />

                {/* Make a Potato Button */}
                <button type="button" onclick={this.clickFirstButton}>Make a Potato!</button>

                <Towers state={this.game} />
            </div>
            
            
        
        
        )
    }
}

export default Main
